"(function() {
    // Installation
    var bridge = window.bridge = {};
    var resolveOnRequestAuthorizationStatus;
    var rejectOnRequestAuthorizationStatus;

    // API
    bridge.onRequestAuthorizationStatus = function() {
        console.log("Request AppTrackingAuthorizationStatus");
        callNative("onRequestAuthorizationStatus");
        return new Promise((resolve, reject) => {
            resolveOnRequestAuthorizationStatus = resolve;
            rejectOnRequestAuthorizationStatus = reject;
        });
    };

    bridge.resolveOnRequestAuthorizationStatusPromise = function(parameters) {
        console.log("Response AppTrackingAuthorizationStatus is succesful: " + parameters);
        resolveOnRequestAuthorizationStatus(parameters);
    };

    bridge.rejectOnRequestAuthorizationStatusPromise = function(parameters) {
        console.log("Response AppTrackingAuthorizationStatus is failed: " + parameters);
        rejectOnRequestAuthorizationStatus(parameters);
    };

    bridge.setConsent = function(framework, consent) {
        if (window.cmp !== undefined && window.cmp.setConsent !== undefined) {
            console.log("Set consent object: " + framework);
            console.log(JSON.stringify(consent));
            window.cmp.setConsent(framework, consent);
        } else {
            console.log("CMP object doesn't exist or respond to setConsent");
        }
    };

    bridge.setApp = function(name, version, image) {
        if (window.cmp !== undefined && window.cmp.setApp !== undefined) {
            console.log("Set app name: " + name + "version: " + version);
            window.cmp.setApp(name, version, image)
        } else {
            console.log("CMP object doesn't exist or respond to setApp");
        }
    }

    bridge.setAuthorizationStatusIOS = function(status) {
        if (window.cmp !== undefined && window.cmp.setAuthorizationStatusIOS !== undefined) {
            console.log("Set AppTrackingAuthorizationStatus: " + status);
            window.cmp.setAuthorizationStatusIOS(status);
        } else {
            console.log("CMP object doesn't exist or respond to setAuthorizationStatusIOS");
        }
    }

    bridge.show = function() {
        if (window.cmp !== undefined && window.cmp.show !== undefined) {
            console.log("Show consent form");
            window.cmp.show().finally(() => {
                console.log("Close consent form");
                callNative("didClose")
            });
        } else {
            console.log("CMP object doesn't exist or respond to show");
        }
    };

    window.cmp.onUpdateConsent = function(framework, object) {
        console.log("Request update consent: " + framework);
        console.log(JSON.stringify(object));
        callNative("onUpdateConsent?" + framework + "&" + JSON.stringify(object))
    }

    // Helpers
    var callNative = function(cmd) {
        window.webkit.messageHandlers.cmhandler.postMessage(cmd);
    };

    // Logs
    console = new Object();
    console.log = function(msg) {
         window.webkit.messageHandlers.loghandler.postMessage("[CMP-Bridge] " + msg);
    };

    console.debug = console.log;
    console.info = console.log;
    console.warn = console.log;
    console.error = console.log;

    window.cmp.onRequestAuthorizationStatusIOS = bridge.onRequestAuthorizationStatus
}());"
